const {
  AccountCircle,
  HomeRounded,
  PhoneAndroidRounded,
} = require("@material-ui/icons");
const { default: InputCustomize } = require("./components/InputCustomize");

export const structure = [
  {
    section: "Infomation",
    fields: [
      {
        name: "fistName",
        title: "First Name",
        icon: () => <AccountCircle />,
        component: InputCustomize,
      },
      {
        name: "lastName",
        title: "Last Name",
        icon: () => <AccountCircle />,
        component: InputCustomize,
      },
      {
        name: "age",
        title: "Age",
        icon: () => <AccountCircle />,
        component: InputCustomize,
      },
    ],
  },
  {
    section: "Contact",
    fields: [
      {
        name: "address",
        title: "Address",
        icon: () => <HomeRounded color="primary" />,
        component:()=> InputCustomize,
      },
      {
        name: "email",
        title: "Email",
        icon: () => <AccountCircle color="primary" />,
        component: InputCustomize,
      },
      {
        name: "phone",
        title: "Phone",
        icon: () => <PhoneAndroidRounded color="primary" />,
        component: InputCustomize,
      },
    ],
  },
  {
    section: "Social Media",
  },
  {
    section: "Infomation",
  },
];
